import React, { useEffect, useState } from 'react';
import profile from '../img/profile.jpg';
import './Profile.css';
import { useNavigate } from 'react-router-dom';
import Postdetails from './Postdetails';
import ProfilePic from './ProfilePic';

export default function Profile() {
  const [posts, setPosts] = useState([]);
  const [show, setShow] = useState(false);
  const [selectedPost, setSelectedPost] = useState({});
  const [user, setUser] = useState({});
  const [changePic, setChangePic] = useState(false);

  const notifyB = (message) => alert(message);

  const toggleDetails = (post) => {
    if (show) {
      setShow(false);
    } else {
      setShow(true);
      setSelectedPost(post);
    }
  };

  const deletePostFromState = (postId) => {
    setPosts(posts.filter(post => post._id !== postId));
  };

  const changeProfilePic = () => {
    setChangePic(!changePic);
  };

  useEffect(() => {
    const userId = JSON.parse(localStorage.getItem("user"))._id;
    console.log("heree "+userId);
    fetch(`http://localhost:5000/user/${userId}`, {
      headers: {
        Authorization: "Bearer " + localStorage.getItem("jwt"),
      },
    })
      .then((res) => res.json())
      .then((result) => {
        setPosts(result.posts);
        setUser(result.user);
      })
      .catch(err => console.log(err));
  }, []);

  return (
    <div className="profile">
      <div className="profile-frame">
        <div className="profile-pic">
          <img onClick={changeProfilePic} src={user.Photo ? user.Photo : profile} alt="profile" />
        </div>
        <div className="profile-data">
          <h1>{user.name}</h1>
          <div className="profile-info" style={{ display: 'flex', justifyContent: 'space-around' }}>
            <p>{posts.length} posts</p>
            <p>{user.followers ? user.followers.length : "0"} followers</p>
            <p>{user.following ? user.following.length : "0"} following</p>
          </div>
        </div>
      </div>
      <hr style={{ width: "90%", margin: "auto", opacity: "0.8" }} />
      <div className="gallery">
        {posts.map((post) => (
          <div key={post._id} className="post">
            <img 
              src={post.photo} 
              onClick={() => toggleDetails(post)} 
              alt="post" 
            />
          </div>
        ))}
      </div>
      {show && <Postdetails item={selectedPost} toggledetails={toggleDetails} onDelete={deletePostFromState} />}
      {changePic && <ProfilePic changeprofile={changeProfilePic} />}
    </div>
  );
}
